export interface ConversationEntry {
    channelAddressIdentifier?: string;
    recipient?: Participant;
    senderDisplayName?: string;
    identifier: string;
    entryType: EntryType;
    entryPayload: AbstractEntry;
    sender: Participant;
    transcriptedTimestamp: number;
    clientTimestamp: number;
    clientDuration: number;
}
export interface Participant {
    appType: AppType;
    subject: string;
    role: string;
}
export interface AbstractEntry {
    entryType: EntryType;
    id: string;
    abstractMessage?: AbstractMessage;
    messageReason?: MessageReason;
}
export interface AbstractMessage {
    messageType: MessageType;
    id: string;
    staticContent?: AbstractStaticContent;
}
export interface AbstractStaticContent {
    formatType: FormatType;
    text?: string;
    attachments?: Attachment[];
}
export interface Attachment {
    name: string;
    attachmentUploadResult?: any;
    id: string;
    mimeType: string;
    url: string;
    referenceId?: string;
}
export type AppType = "custom" | "chatbot" | "agent" | "conversation";
export type EntryType = "Message" | "MessageDeliveryFailed" | "TypingStartedIndicator" | "TypingStoppedIndicator" | "ParticipantChanged" | "MessageUpdated";
export type MessageType = "StaticContentMessage";
export type FormatType = "Text" | "Attachments";
export type MessageReason = "AutomatedResponse" | "Consent" | undefined;
